import starFull from './star_full.svg';
import starHalf from './star_half.svg';

export default function StarIcon({star}) {

    return (
        <>
        { 
            star === 1 ?
            <img src={starFull} />
            : star === 0.5 
            ? <img src={starHalf} /> : null
        }
        </>
    )
}
